import React, { useState } from 'react'
import  './Update.css' ;
import { Row , Form , Button, Col} from 'react-bootstrap';
import { Link } from 'react-router-dom';

export default function AddData() {
    let [data , setData] = useState({
        'name' : '' ,
        'phone' : '',
        'email' : ''
    }) ;

const onHandle = (event) => {
    let key = event.target.name ;
    let value = event.target.value ;

    setData(prevData => ( {
        ...prevData , 
        [key] : value 
    }))

}
  return (
    <>  
        <div className='first'>
            <h3> Add Student Info</h3>
            <Form className='form'>
                
                <Row> 
                    
                    <Col>
                        <Form.Control value={data.name} onChange={(event)=> onHandle(event)} placeholder="Name"  className='textBox' name='name' required/>
                    </Col>
                    
                </Row>
                <Row> 
                    <Col>
                        <Form.Control  value={data.name} onChange={(event)=> onHandle(event)} placeholder="Phone number" type='number' name='phone'  className='textBox' required/>
                    </Col>
                    <Col>
                        <Form.Control  value={data.name} onChange={(event)=> onHandle(event)} placeholder="Email" type='email' name='email' className='textBox' required />
                    </Col>
                </Row>
                
                <Row> <Link to={'/'} className='button'>
                    <Button >
                               Save Data 
                     </Button> </Link>
                </Row>


            </Form>
        </div>
    </>
  )
}
